(() => {
	const initializeTheme = () => {
		let theme = localStorage.getItem("theme");

		const getDefaultTheme = () => theme || (window.matchMedia("(prefers-color-scheme: dark)").matches ? "dark" : "light");

		const setTheme = (newTheme) => {
			if (newTheme === "auto") {
				newTheme = window.matchMedia("(prefers-color-scheme: dark)").matches ? "dark" : "light";
			}


			document.getElementById('app-extension').setAttribute("data-bs-theme", newTheme);
		};

		const updateNavbar = (currentTheme) => {
			let navbar = document.getElementById("navbar");
			if (navbar) {
				if (currentTheme === "light" || currentTheme === "auto") {
					navbar.classList.remove("navbar-dark", "bg-transparent");
					navbar.classList.add("navbar-light", "bg-transparent");
				} else {
					navbar.classList.remove("navbar-light", "bg-transparent");
					navbar.classList.add("navbar-dark", "bg-transparent");
				}
			}
		};

		const updateSidebar = (currentTheme) => {
			let sidebar = document.getElementById("sidebar");
			if (sidebar) {
				if (currentTheme === "light" || currentTheme === "auto") {
					sidebar.classList.remove("navbar-dark", "bg-transparent");
					sidebar.classList.add("navbar-light", "bg-transparent");
				} else {
					sidebar.classList.remove("navbar-light", "bg-transparent");
					sidebar.classList.add("navbar-dark", "bg-transparent");
				}
			}
		};

		const handleThemeChange = (newTheme) => {
			const toggle = document.getElementById("toggle_light_dark");
			const label = document.getElementById("toggle_light_dark_label");

			// Update toggle switch state
			toggle.checked = newTheme === "dark";

			// Update label text
			label.textContent = newTheme === "dark" ? "Light Mode" : "Dark Mode";

			updateNavbar(newTheme);
			updateSidebar(newTheme);
		};

		window.matchMedia("(prefers-color-scheme: dark)").addEventListener("change", () => {
			if (theme !== "light" && theme !== "dark") {
				setTheme(getDefaultTheme());
			}
		});

		const currentTheme = getDefaultTheme();
		setTheme(currentTheme);
		handleThemeChange(currentTheme);

		document.getElementById("toggle_light_dark").addEventListener("change", (event) => {
			const newTheme = event.target.checked ? "dark" : "light";
			localStorage.setItem("theme", newTheme);
			setTheme(newTheme);
			handleThemeChange(newTheme);
		});
	};

	const waitForElement = (selector, callback) => {
		const element = document.querySelector(selector);
		if (element) {
			callback(element);
		} else {
			setTimeout(() => waitForElement(selector, callback), 100);
		}
	};

	waitForElement('#app-extension', initializeTheme);
})();




